import React, {Fragment} from 'react';

class Discografia extends React.Component {
    render () {
        return (
            <div>
                <img src='https://www.google.com/url?sa=i&source=images&cd=&cad=rja&uact=8&ved=2ahUKEwjO293P6rfjAhVph1QKHc-ECpEQjRx6BAgBEAU&url=%2Furl%3Fsa%3Di%26source%3Dimages%26cd%3D%26ved%3D%26url%3Dhttps%253A%252F%252Fwww.billboard.com%252Farticles%252Fcolumns%252Fpop%252F7760476%252Fharry-styles-solo-album-artwork-analysis%26psig%3DAOvVaw3AUohkL5b0z_mMNXZNDnX3%26ust%3D1563311306517194&psig=AOvVaw3AUohkL5b0z_mMNXZNDnX3&ust=1563311306517194' alt="Cover"/>
                <p>Kiwi</p>                
                <p>Harry Styles</p>                
            </div>
        );
    }
}



class PlayerContainer extends React.Component {
    render() {
        return(
            <Fragment>
                <div className='player'>
                    <footer>
                        <Discografia/>
                    </footer>
                </div>
            </Fragment>
        );
    }
}

export default PlayerContainer;
